import React from 'react';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import logo from './logo.svg';
import './App.css';
import Header from './components/Header'
import Nav from './components/Nav'
import Home from './components/Home'
import About from './components/About'
import Photography from './components/Photography'
import Saginaw from './components/Saginaw'
import Detroit from './components/Detroit'
import Houston from './components/Houston'
import SanFrancisco from './components/SanFrancisco'
import Resume from './components/Resume'

function App() {
  return (

    <BrowserRouter>
    <Header />
    <Nav />
    <Routes>
      <Route path="/home" element={<Home />} />
      <Route path="/about" element={<About />} />

      <Route path="/photography" element={<Photography />}/>
      <Route path="/saginaw" element={<Saginaw />}/>
      <Route path="/detroit" element={<Detroit />}/>
      <Route path="/houston" element={<Houston />}/>
      <Route path="/san-francisco" element={<SanFrancisco />}/>
      <Route path="/resume" element={<Resume />}/>

    </Routes>
    </BrowserRouter>
    // <div className="App">
    //   <header className="App-header">
    //     <img src={logo} className="App-logo" alt="logo" />
    //     <p>
    //       Edit <code>src/App.js</code> and save to reload.
    //     </p>
    //     <a
    //       className="App-link"
    //       href="https://reactjs.org"
    //       target="_blank"
    //       rel="noopener noreferrer"
    //     >
    //       Learn React
    //     </a>
    //   </header>
    // </div>
  );
}

export default App;
